window.bookSummaryJSON = "<p>A riveting tale of magic, mystery, and adventure, The Chronicles of William Wilde will thrill listeners who loved The Summoner Trilogy and The Maze Runner. </p> <p>On a cold winter's night, just shy of his 17th birthday, William Wilde became an orphan. It was a simple car accident that claimed the lives of his family. </p> <p>Eight months later, at the start of his senior year of high school, a beautiful, mysterious girl enters William's life. Captivating and confident, she holds secrets about William's heritage, secrets of which he himself is unaware: rare magic flows in William's veins. </p> <p>And watching William from afar is Kohl Obsidian, a monstrous, undead horror. He won't rest until the tragedy he started eight months ago culminates with William's death. </p> <p>William's life hangs in the balance, and he must discover a means to vanquish a creature that has never been defeated. </p> <p>Enter a mystical world where heroes are forged from the unlikeliest of metals. </p>"; 
